void solve() {
    int n;
    cin >> n;
    vector<vector<int>> g(n);
    rep(i, n - 1) {
        int u, v;
        cin >> u >> v;
        u--; v--;
        g[u].pb(v);
        g[v].pb(u);
    }

    vector<int> dep(n, -1), par(n);
    queue<int> q;
    dep[0] = 0;
    q.push(0);
    while (!q.empty()) {
        int u = q.front();
        q.pop();
        for (int v : g[u]) {
            if (dep[v] == -1) {
                dep[v] = dep[u] + 1;
                par[v] = u;
                q.push(v);
            }
        }
    }

    vector<int> ord(n);
    iota(all(ord), 0);
    sort(all(ord), [&](int a, int b) {
        return dep[a] > dep[b];
    });

    vector<bool> factor(n);
    for (int i = 1; i * i <= n - 1; i++) {
        if ((n - 1) % i == 0) {
            factor[i] = true;
            if (i * i != n) {
                factor[(n - 1) / i] = true;
            }
        }
    }

    rng(k, 1, n) {
        if (!factor[k]) {
            cout << 0;
            continue;
        }

        vector<int> out(n, 1 % k);
        out[0] = 0;

        bool ok = true;

        for (int u : ord) {
            vector<int> in;
            for (int v : g[u]) {
                if (v != par[u] && out[v] > 0) {
                    in.pb(out[v]);
                }
            }

            if (sz(in) % 2) {
                int ex = accumulate(all(in), 0) - sz(in) / 2 * k;

                if (find(all(in), ex) == in.end()) {
                    ok = false;
                    break;
                }
                in.erase(find(all(in), ex));

                out[u] = (out[u] + ex) % k;
            }

            multiset<int> st;
            for (int x : in) {
                if (st.find(k - x) != st.end()) {
                    st.erase(st.find(k - x));
                } else {
                    st.insert(x);
                }
            }

            ok &= st.empty();
        }

        cout << ok;
    }
}

