    public static String algorithm2(String message) {
        message = message.replace(" ", "");
        String result = "";
        int total = 0;

        for (int i = 0; i < message.length(); i++) {
            String c = message.substring(i);
            if (!result.contains(c)) {
                int count = 0;
                for (int j = 0; j < message.length(); j++) {
                    if (message.substring(j).equals(c)) {
                        count++;
                    }
                }
                result += c + "" + count;
                total++;
            }
        }
        return result;
